import GlobalStyles from "./components/Reset";
import styled from "styled-components";
import PropTypes from "prop-types";
import Header from "./components/Header";
import Footer from "./components/Footer";
import Introduction from "./components/Introduction";
import NoticeWrite from "./components/NoticeWrite";

function App() {
  const Page = styled.div`
    width: 100vw;
    height: 100vh;
    position: relative;
  `;
  const NavTitle = styled.div`
    width: 100%;
    height: 3rem;
    border: 3px solid var(--dark-brown);
    background-color: var(--red-brown);
    display: flex;
    justify-content: flex-start;
    align-items: center;
    box-sizing: border-box;
    position: absolute;
    top: 6rem;
  `;
  const NavTitleText = styled.span`
    font-size: 1rem;
    font-weight: 600;
    color: var(--cream);
    padding-left: 1rem;
  `;
  return (
    <Page>
      <GlobalStyles />
      <Header />
      <NavTitle>
        <NavTitleText>클럽 소개</NavTitleText>
        {/*MenusAPI.map((title) => (
          <NavTitleText className="NavTitleText__name" key={title}>
            {title}
          </NavTitleText>
        ))*/}
      </NavTitle>
      <NoticeWrite />
      <Footer />
    </Page>
  );
}

/*
MenusAPI.propTypes = {
    title: PropTypes.string.isRequired,
    };
*/

export default App;
